import "./NewExpense.css";
import ExpenseForm from "./ExpenseForm";

function NewExpense() {
  const expenseDataHandler = (enteredExpenseData) => {
    const expense = {
      ...enteredExpenseData,
    };

    console.log(expense);
  };
  return (
    <div className="new-expense">
      <ExpenseForm onSaveExpenseData={expenseDataHandler} />
    </div>
  );
}

export default NewExpense;
